import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
    viewHeader: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginTop: 8,
        marginLeft: 10,
    },
    textHeader: {
        fontSize: 25,
        color: 'white',
        fontWeight: "bold",
        marginRight: 75
    }
})

export default styles
